/****** Object:  StoredProcedure [dbo].[USP_GETSET_MQ_ABNORMAL_RESULT]    Script Date: 2022-01-28 오전 11:44:50 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO


CREATE PROCEDURE [dbo].[USP_GETSET_MQ_ABNORMAL_RESULT]
(
	@IN_SENT	CHAR(1)
)
AS
BEGIN
	IF (@IN_SENT = 'N')
	BEGIN
		UPDATE TBL_SPC_ABNORMAL_RESULT SET IS_SENT = 'S'
		WHERE ISDOOSAN_ITEM = 'Y' AND ISNULL(IS_SENT, 'N') = @IN_SENT

		SELECT A.LOT_ID lotId 
			, A.FACT_ID factId
			, '' factNameK
			, '' factNameE
			, '' factNameJ
			, '' factNameC
			/* 2020-06-23  mq 전송하지 않음
			, F.NAME_K factNameK
			, F.NAME_E factNameE
			, F.NAME_J factNameJ
			, F.NAME_C factNameC
			*/
			, A.PROC_ID procId
			, '' procNameK
			, '' procNameE
			, '' procNameJ
			, '' procNameC
			/* 2020-06-23  mq 전송하지 않음
			, P.NAME_K procNameK
			, P.NAME_E procNameE
			, P.NAME_J procNameJ
			, P.NAME_C procNameC
			*/

			, A.LINE_ID lineId
			, '' lineNameK
			, '' lineNameE
			, '' lineNameJ
			, '' lineNameC
			/* 2020-06-23  mq 전송하지 않음
			, L.NAME_K lineNameK
			, L.NAME_E lineNameE
			, L.NAME_J lineNameJ
			, L.NAME_C lineNameC
			*/

			, A.GODS_ID godsId
			, '' godsNameK
			, '' godsNameE
			, '' godsNameJ
			, '' godsNameC 
			/* 2020-06-23  mq 전송하지 않음
			, G.NAME_K godsNameK
			, G.NAME_E godsNameE
			, G.NAME_J godsNameJ
			, G.NAME_C godsNameC 
			*/
    
			, A.INSP_ID inspId
			, '' inspNameK
			, '' inspNameE
			, '' inspNameJ
			, '' inspNameC
			/* 2020-06-23  mq 전송하지 않음
			, I.NAME_K inspNameK
			, I.NAME_E inspNameE
			, I.NAME_J inspNameJ
			, I.NAME_C inspNameC
			*/

			, A.INSPECT_DT inspectDt

			, A.ABNORMAL_TYPE abnormalType

			, A.ABNORMAL_ACTION_CODE abnormalActionCode
			, A.ABNORMAL_ACTION abnormalActionName

			, A.CHECK_POINT_CODE checkPointCode
			, A.CHECK_POINT checkPointName

			, TREAT_YN treatYn

			, A.CRUD crud
			, A.INDEX_KEY idxKey
			, A.IS_SENT

			, A.INSERT_DT insertDt
			, A.UPDATE_DT updateDt
			, A.INSERT_USERID insertUserId
			, B2.USER_NAME insertUserName
			, A.UPDATE_USERID updateUserId
			, C2.USER_NAME updateUserName

			, A.USENCHANGED_DT treatYChangedDt
			, A.USENCHANGED_USERID treatYChangedUserId
			, D2.USER_NAME treatYChangedUserName

		FROM TBL_SPC_ABNORMAL_RESULT A    
		INNER JOIN TBL_SPC_GOODSINSPECT GI ON  GI.ISDOOSAN_ITEM = 'Y'  
			  AND GI.USE_YN = 'Y'
			  AND A.FACT_ID = GI.FACT_ID 
			  AND A.PROC_ID = GI.PROC_ID
			   AND A.LINE_ID = GI.LINE_ID
			   AND A.GODS_ID = GI.GODS_ID
			   AND A.INSP_ID = GI.INSP_ID
	--        INNER JOIN TBL_COM_GOODS G ON A.GODS_ID = G.GODS_ID AND G.USE_YN = 'Y'
	--        LEFT JOIN TBL_COM_FACTORY F ON A.FACT_ID = F.FACT_ID AND F.USE_YN = 'Y'
	--        LEFT JOIN TBL_COM_PROCESS P ON A.PROC_ID = P.PROC_ID AND P.USE_YN = 'Y'
	--        LEFT JOIN TBL_SPC_INSPECT I ON A.INSP_ID = I.INSP_ID AND I.USE_YN = 'Y'
	--        LEFT JOIN TBL_COM_LINE L ON A.LINE_ID = L.LINE_ID AND L.USE_YN = 'Y'
			LEFT JOIN TBL_COM_MEMBERS B2 ON A.INSERT_USERID = B2.USER_ID
			LEFT JOIN TBL_COM_MEMBERS C2 ON A.UPDATE_USERID = C2.USER_ID
			LEFT JOIN TBL_COM_MEMBERS D2 ON A.USENCHANGED_USERID = D2.USER_ID
		WHERE A.ISDOOSAN_ITEM = 'Y' AND ISNULL(A.IS_SENT, 'N') = 'S'
	END
	ELSE IF (@IN_SENT = 'S')
	BEGIN
		UPDATE TBL_SPC_ABNORMAL_RESULT SET IS_SENT = 'Y'
		WHERE ISDOOSAN_ITEM = 'Y' AND IS_SENT = @IN_SENT
	END

END

GO
/****** Object:  StoredProcedure [dbo].[USP_GETSET_MQ_CALC_LIST_TEST]    Script Date: 2022-01-28 오전 11:44:50 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE PROCEDURE [dbo].[USP_GETSET_MQ_CALC_LIST_TEST]
(
	@IN_SENT	CHAR(1)
)
AS
BEGIN

	IF (@IN_SENT = 'N')
	BEGIN
		UPDATE TBL_SPC_PROCESSINDEX_DETAIL SET IS_SENT = 'S'
		FROM TBL_SPC_PROCESSINDEX_DETAIL A
		INNER JOIN TBL_SPC_PROCESSINDEX_MASTER B ON A.PROCESSINDEX_ID = B.PROCESSINDEX_ID
		INNER JOIN TBL_SPC_GOODSINSPECT GI ON B.FACT_ID = GI.FACT_ID  
		WHERE A.PROCESSINDEX_ID IN (SELECT PROCESSINDEX_ID
				FROM TBL_SPC_PROCESSINDEX_MASTER
				WHERE 1=1)
				AND GI.ISDOOSAN_ITEM = 'Y'  
				AND GI.USE_YN = 'Y'  
				AND ISNULL(A.IS_SENT, 'N') = @IN_SENT


		SELECT A.PROCESSINDEX_YEAR          piY 
				, A.PROCESSINDEX_MONTH	        piM
				, A.PROCESSINDEX_WEEK	        piW
				, A.PROCESSINDEX_DAY	        piD
				, B.FACT_ID                     factId
				, ''                      factNameK
				, ''                      factNameE
				, ''                      factNameJ
				, ''                      factNameC
					/* 2020-06-23  mq 전송하지 않음
				, F.NAME_K                      factNameK
				, F.NAME_E                      factNameE
				, F.NAME_J                      factNameJ
				, F.NAME_C                      factNameC
					*/

				, B.PROC_ID                     procId
				, ''                      procNameK
				, ''                      procNameE
				, ''                      procNameJ
				, ''                      procNameC
					/* 2020-06-23  mq 전송하지 않음
				, P.NAME_K                      procNameK
				, P.NAME_E                      procNameE
				, P.NAME_J                      procNameJ
				, P.NAME_C                      procNameC
					*/

				, B.LINE_ID                     lineId
				, ''                      lineNameK
				, ''                      lineNameE
				, ''                      lineNameJ
				, ''                      lineNameC
					/* 2020-06-23  mq 전송하지 않음
				, L.NAME_K                      lineNameK
				, L.NAME_E                      lineNameE
				, L.NAME_J                      lineNameJ
				, L.NAME_C                      lineNameC
					*/

				, B.GODS_ID                     godsId
				, ''                      godsNameK
				, ''                      godsNameE
				, ''                      godsNameJ
				, ''                      godsNameC 
					/* 2020-06-23  mq 전송하지 않음
				, G.NAME_K                      godsNameK
				, G.NAME_E                      godsNameE
				, G.NAME_J                      godsNameJ
				, G.NAME_C                      godsNameC 
					*/
	
				, B.INSP_ID                     inspId
				, ''                      inspNameK
				, ''                      inspNameE
				, ''                      inspNameJ
				, ''                      inspNameC
					/* 2020-06-23  mq 전송하지 않음
				, I.NAME_K                      inspNameK
				, I.NAME_E                      inspNameE
				, I.NAME_J                      inspNameJ
				, I.NAME_C                      inspNameC
					*/

				, A.SPEC_LOWER					specLower
				, A.SPEC_MID					specMid
				, A.SPEC_UPPER					specUpper
				, A.CONTROLLIMIT_LOWER			lcl
				, A.CONTROLLIMIT_MID			cl
				, A.CONTROLLIMIT_UPPER			ucl
				, A.SUB_CONTROLLIMIT_MID		rcl
				, A.SUB_CONTROLLIMIT_UPPER		rucl  
				, A.OPL_YN						oplYn

				, A.PROCESSINDEX_CP		        piCp
				, A.PROCESSINDEX_CPK	        piCpk
				, A.PROCESSINDEX_PP		        piPp
				, A.PROCESSINDEX_PPK	        piPpk
				, A.SAMPLESIZE			        samplesize
				, A.AVERAGE				        average
				, A.STDDEV				        stddev
				, A.VARIANCE			        variance
				, A.CRUD				        crud
				, A.INDEX_KEY			        idxKey
				, A.RAWNUM                      rawNumber
			FROM TBL_SPC_PROCESSINDEX_DETAIL A
			INNER JOIN TBL_SPC_PROCESSINDEX_MASTER B ON A.PROCESSINDEX_ID = B.PROCESSINDEX_ID
			INNER JOIN TBL_SPC_GOODSINSPECT GI ON B.FACT_ID = GI.FACT_ID 
			   AND B.PROC_ID = GI.PROC_ID
 				 AND B.LINE_ID = GI.LINE_ID
 				 AND B.GODS_ID = GI.GODS_ID
 				 AND B.INSP_ID = GI.INSP_ID
			WHERE A.PROCESSINDEX_ID IN (SELECT PROCESSINDEX_ID
				FROM TBL_SPC_PROCESSINDEX_MASTER
				WHERE 1=1)
				AND GI.ISDOOSAN_ITEM = 'Y'  
				AND GI.USE_YN = 'Y'  
				AND ISNULL(A.IS_SENT, 'N') = 'S'
	END
	ELSE IF (@IN_SENT = 'S')
	BEGIN
		UPDATE TBL_SPC_PROCESSINDEX_DETAIL SET IS_SENT = 'Y'
		FROM TBL_SPC_PROCESSINDEX_DETAIL A
		INNER JOIN TBL_SPC_PROCESSINDEX_MASTER B ON A.PROCESSINDEX_ID = B.PROCESSINDEX_ID
		INNER JOIN TBL_SPC_GOODSINSPECT GI ON B.FACT_ID = GI.FACT_ID  
		WHERE A.PROCESSINDEX_ID IN (SELECT PROCESSINDEX_ID
				FROM TBL_SPC_PROCESSINDEX_MASTER
				WHERE 1=1)
				AND GI.ISDOOSAN_ITEM = 'Y'  
				AND GI.USE_YN = 'Y'  
				AND A.IS_SENT = @IN_SENT
	END


END
