			, A.USENCHANGED_DT useNChangedDt
			, A.USENCHANGED_USERID useNChangedUserId
			, D.USER_NAME useNChangedUserName
			, A.USE_YN useYn
			, A.CRUD crud
			, A.INDEX_KEY idxKey
		FROM TBL_COM_CODEINFO A
		LEFT JOIN TBL_COM_MEMBERS B ON A.INSERT_USERID = B.USER_ID
		LEFT JOIN TBL_COM_MEMBERS C ON A.UPDATE_USERID = C.USER_ID
