CREATE PROCEDURE [dbo].[USP_GETSET_MQ_GOODSINSPECT_LIST]
(
	@IN_SENT	CHAR(1)
)
AS
BEGIN
	IF (@IN_SENT = 'N')
	BEGIN

	UPDATE TBL_SPC_GOODSINSPECT SET IS_SENT = 'S'
		WHERE ISDOOSAN_ITEM = 'Y' AND ISNULL(IS_SENT, 'N') = @IN_SENT

    SELECT GI.FACT_ID factId
			, '' factNameK
			, '' factNameE
			, '' factNameJ
			, '' factNameC
			/* 2020-06-23  mq 전송하지 않음
			, F.NAME_K factNameK
			, F.NAME_E factNameE
			, F.NAME_J factNameJ
			, F.NAME_C factNameC
			*/

			, GI.PROC_ID procId
			, '' procNameK
			, '' procNameE
			, '' procNameJ
			, '' procNameC
			/* 2020-06-23  mq 전송하지 않음
			, P.NAME_K procNameK
			, P.NAME_E procNameE
			, P.NAME_J procNameJ
			, P.NAME_C procNameC
			*/

			, GI.LINE_ID lineId
			, '' lineNameK
			, '' lineNameE
			, '' lineNameJ
			, '' lineNameC
			/* 2020-06-23  mq 전송하지 않음
			, L.NAME_K lineNameK
			, L.NAME_E lineNameE
			, L.NAME_J lineNameJ
			, L.NAME_C lineNameC
			*/

			, GI.GODS_ID godsId
			, '' godsNameK
			, '' godsNameE
			, '' godsNameJ
			, '' godsNameC 
			/* 2020-06-23  mq 전송하지 않음
			, G.NAME_K godsNameK
			, G.NAME_E godsNameE
			, G.NAME_J godsNameJ
			, G.NAME_C godsNameC 
			*/
    
			, GI.INSP_ID inspId
			, '' inspNameK
			, '' inspNameE
			, '' inspNameJ
			, '' inspNameC
			/* 2020-06-23  mq 전송하지 않음
			, I.NAME_K inspNameK
			, I.NAME_E inspNameE
			, I.NAME_J inspNameJ
			, I.NAME_C inspNameC
			*/
    
			, GI.UNIT unit
			, UT.NAME_K unitNameK
			, UT.NAME_E unitNameE
			, UT.NAME_J unitNameJ
			, UT.NAME_C unitNameC

			, GI.DATA_TYPE dataType
			, DT.NAME_K dataTypeNameK
			, DT.NAME_E dataTypeNameE
			, DT.NAME_J dataTypeNameJ
			, DT.NAME_C dataTypeNameC 

			, GI.QUA_TYPE quaType
			, GI.SAMPLESIZE sampleSize
			, GI.CHARTCODE chartCode
			, GI.SPEC_LOWER specLower
			, GI.SPEC_MID specMid
			, GI.SPEC_UPPER specUpper
			, GI.LOPL lopl
			, GI.OPL opl
			, GI.UOPL uopl
			, GI.RLOPL rlopl
			, GI.ROPL ropl
			, GI.RUOPL ruopl
			, GI.Cp_Cpk_Use cpCpkUse 
			, GI.OPL_YN oplYn

			, GI.INSERT_DT insertDt
			, GI.UPDATE_DT updateDt
			, GI.INSERT_USERID insertUserId
			, B2.USER_NAME insertUserName
			, GI.UPDATE_USERID updateUserId
			, C2.USER_NAME updateUserName
			, GI.USENCHANGED_DT useNChangedDt
			, GI.USENCHANGED_USERID useNChangedUserId
			, D2.USER_NAME useNChangedUserName

			, GI.USE_YN useYn
			, GI.CRUD crud
			, GI.GOODSINSPECT_ID idxKey
		FROM TBL_SPC_GOODSINSPECT GI
	--        INNER JOIN TBL_COM_FACTORY F ON GI.FACT_ID = F.FACT_ID AND F.USE_YN = 'Y'
	--        INNER JOIN TBL_COM_PROCESS P ON GI.PROC_ID = P.PROC_ID AND P.USE_YN = 'Y'
	--        INNER JOIN TBL_COM_LINE L ON GI.LINE_ID = L.LINE_ID AND L.USE_YN = 'Y'
	--        INNER JOIN TBL_COM_GOODS G ON GI.GODS_ID = G.GODS_ID AND G.USE_YN = 'Y'
	--        INNER JOIN TBL_SPC_INSPECT I ON GI.INSP_ID = I.INSP_ID AND I.USE_YN = 'Y'
			LEFT JOIN TBL_COM_CODEINFO UT ON GI.UNIT = UT.CODE AND UT.GROUP_CODE = 'unit' AND UT.USE_YN = 'Y'
			LEFT JOIN TBL_COM_CODEINFO DT ON GI.DATA_TYPE = DT.CODE AND DT.GROUP_CODE = 'dataType' AND DT.USE_YN = 'Y'
			LEFT JOIN TBL_COM_MEMBERS B2 ON GI.INSERT_USERID = B2.USER_ID
			LEFT JOIN TBL_COM_MEMBERS C2 ON GI.UPDATE_USERID = C2.USER_ID
			LEFT JOIN TBL_COM_MEMBERS D2 ON GI.USENCHANGED_USERID = D2.USER_ID
		WHERE GI.ISDOOSAN_ITEM = 'Y' AND ISNULL(GI.IS_SENT, 'N') = 'S'
	END
	ELSE IF (@IN_SENT = 'S')
	BEGIN
		UPDATE TBL_SPC_GOODSINSPECT SET IS_SENT = 'Y'
		WHERE ISDOOSAN_ITEM = 'Y' AND IS_SENT = @IN_SENT
	END
END

