CREATE PROCEDURE [dbo].[USP_GETSET_MQ_INSPECT_DATA]
(
	@IN_SENT	CHAR(1)
)

AS
BEGIN
    SET NOCOUNT ON;

	IF (@IN_SENT = 'N')
	BEGIN
		UPDATE TBL_SPC_INSPECT_DATA SET IS_SENT = 'S'
		FROM TBL_SPC_INSPECT_DATA A 
		INNER JOIN TBL_SPC_GOODSINSPECT GI ON  GI.ISDOOSAN_ITEM = 'Y' AND GI.USE_YN = 'Y'
			  AND A.FACT_ID = GI.FACT_ID 
			  AND A.PROC_ID = GI.PROC_ID
			   AND A.LINE_ID = GI.LINE_ID
			   AND A.GODS_ID = GI.GODS_ID
			  AND A.INSP_ID = GI.INSP_ID
		WHERE ISNULL(A.IS_SENT, 'N') = @IN_SENT
        
		SELECT A.LOT_ID lotId 
			, A.FACT_ID factId
			, '' factNameK
			, '' factNameE
			, '' factNameJ
			, '' factNameC
			/* 2020-06-23  mq 전송하지 않음
			, F.NAME_K factNameK
			, F.NAME_E factNameE
			, F.NAME_J factNameJ
			, F.NAME_C factNameC
			*/

			, A.PROC_ID procId
			, '' procNameK
			, '' procNameE
			, '' procNameJ
			, '' procNameC
			/* 2020-06-23  mq 전송하지 않음
			, P.NAME_K procNameK
			, P.NAME_E procNameE
			, P.NAME_J procNameJ
			, P.NAME_C procNameC
			*/

			, A.LINE_ID lineId
			, '' lineNameK
			, '' lineNameE
			, '' lineNameJ
			, '' lineNameC
			/* 2020-06-23  mq 전송하지 않음
			, L.NAME_K lineNameK
			, L.NAME_E lineNameE
			, L.NAME_J lineNameJ
			, L.NAME_C lineNameC
			*/

			, A.GODS_ID godsId
			, '' godsNameK
			, '' godsNameE
			, '' godsNameJ
			, '' godsNameC 
			/* 2020-06-23  mq 전송하지 않음
			, G.NAME_K godsNameK
			, G.NAME_E godsNameE
			, G.NAME_J godsNameJ
			, G.NAME_C godsNameC 
			*/
    
			, A.INSP_ID inspId
			, '' inspNameK
			, '' inspNameE
			, '' inspNameJ
			, '' inspNameC
			/* 2020-06-23  mq 전송하지 않음
			, I.NAME_K inspNameK
			, I.NAME_E inspNameE
			, I.NAME_J inspNameJ
			, I.NAME_C inspNameC
			*/

			, A.SEQ seq
			, A.INSPECT_DT idt
			, A.INSP_DATA idata
			, A.CRUD crud
			, A.INDEX_KEY idxKey
			, A.IS_SENT
		FROM [dbo].[TBL_SPC_INSPECT_DATA] A
		INNER JOIN TBL_SPC_GOODSINSPECT GI ON  GI.ISDOOSAN_ITEM = 'Y'  
			  AND GI.USE_YN = 'Y'
			  AND A.FACT_ID = GI.FACT_ID 
			  AND A.PROC_ID = GI.PROC_ID
			   AND A.LINE_ID = GI.LINE_ID
			   AND A.GODS_ID = GI.GODS_ID
			  AND A.INSP_ID = GI.INSP_ID
	--        INNER JOIN TBL_COM_GOODS G ON A.GODS_ID = G.GODS_ID AND G.USE_YN = 'Y'
	--        LEFT JOIN TBL_COM_FACTORY F ON A.FACT_ID = F.FACT_ID AND F.USE_YN = 'Y'
	--        LEFT JOIN TBL_COM_PROCESS P ON A.PROC_ID = P.PROC_ID AND P.USE_YN = 'Y'
	--        LEFT JOIN TBL_SPC_INSPECT I ON A.INSP_ID = I.INSP_ID AND I.USE_YN = 'Y'
	--        LEFT JOIN TBL_COM_LINE L ON A.LINE_ID = L.LINE_ID AND L.USE_YN = 'Y'
		WHERE ISNULL(A.IS_SENT,'N') = 'S'
		ORDER BY LOT_ID, SEQ
	END
	ELSE IF (@IN_SENT = 'S')
	BEGIN
		UPDATE TBL_SPC_INSPECT_DATA SET IS_SENT = 'Y'
		FROM TBL_SPC_INSPECT_DATA A 
		INNER JOIN TBL_SPC_GOODSINSPECT GI ON  GI.ISDOOSAN_ITEM = 'Y' AND GI.USE_YN = 'Y'
			  AND A.FACT_ID = GI.FACT_ID 
			  AND A.PROC_ID = GI.PROC_ID
			   AND A.LINE_ID = GI.LINE_ID
			   AND A.GODS_ID = GI.GODS_ID
			  AND A.INSP_ID = GI.INSP_ID
		WHERE A.IS_SENT = @IN_SENT
	END

END

