CREATE PROCEDURE [dbo].[USP_GETSET_MQ_SPECOUT_RESULT]
(
	@IN_SENT	CHAR(1)
)
AS
BEGIN
	IF (@IN_SENT = 'N')
	BEGIN
		UPDATE TBL_SPC_ABNORMAL_RESULT SET IS_SENT = 'S'
		FROM TBL_SPC_SPECOUT_RESULT A
		INNER JOIN TBL_SPC_GOODSINSPECT GI ON  GI.ISDOOSAN_ITEM = 'Y'  
			  AND GI.USE_YN = 'Y'
			  AND A.FACT_ID = GI.FACT_ID 
			  AND A.PROC_ID = GI.PROC_ID
			   AND A.LINE_ID = GI.LINE_ID
			   AND A.GODS_ID = GI.GODS_ID
			   AND A.INSP_ID = GI.INSP_ID
		WHERE A.ISDOOSAN_ITEM = 'Y' AND ISNULL(A.IS_SENT, 'N') = @IN_SENT

		SELECT A.LOT_ID lotId 
			, A.FACT_ID factId
			, '' factNameK
			, '' factNameE
			, '' factNameJ
			, '' factNameC
			/* 2020-06-23  mq 전송하지 않음
			, F.NAME_K factNameK
			, F.NAME_E factNameE
			, F.NAME_J factNameJ
			, F.NAME_C factNameC
			*/

			, A.PROC_ID procId
			, '' procNameK
			, '' procNameE
			, '' procNameJ
			, '' procNameC
			/* 2020-06-23  mq 전송하지 않음
			, P.NAME_K procNameK
			, P.NAME_E procNameE
			, P.NAME_J procNameJ
			, P.NAME_C procNameC
			*/

			, A.LINE_ID lineId
			, '' lineNameK
			, '' lineNameE
			, '' lineNameJ
			, '' lineNameC
			/* 2020-06-23  mq 전송하지 않음
			, L.NAME_K lineNameK
			, L.NAME_E lineNameE
			, L.NAME_J lineNameJ
			, L.NAME_C lineNameC
			*/

			, A.GODS_ID godsId
			,'' godsNameK
			, '' godsNameE
			, '' godsNameJ
			, '' godsNameC 
			/* 2020-06-23  mq 전송하지 않음
			, G.NAME_K godsNameK
			, G.NAME_E godsNameE
			, G.NAME_J godsNameJ
			, G.NAME_C godsNameC 
			*/
    
			, A.INSP_ID inspId
			, '' inspNameK
			, '' inspNameE
			, '' inspNameJ
			, '' inspNameC
			/* 2020-06-23  mq 전송하지 않음
			, I.NAME_K inspNameK
			, I.NAME_E inspNameE
			, I.NAME_J inspNameJ
			, I.NAME_C inspNameC
			*/

			, A.INSPECT_DT inspectDt

			, A.SPEC_LOWER    specLower
			, A.SPEC_MID    specMid
			, A.SPEC_UPPER    specUpper

			, SPECOUT_TYPE specoutType
			, SPT.NAME_K specoutNameK
			, SPT.NAME_E specoutNameE
			, SPT.NAME_J specoutNameJ
			, SPT.NAME_C specoutNameC

			, CHECK_POINT_CODE checkPointCode
			, '' checkPointNameK
			, '' checkPointNameE
			, '' checkPointNameJ
			, '' checkPointNameC
			, '' inspNameC
			/* 2020-06-23  mq 전송하지 않음
			, SCP.NAME_K checkPointNameK
			, SCP.NAME_E checkPointNameE
			, SCP.NAME_J checkPointNameJ
			, SCP.NAME_C checkPointNameC
			*/

			, TREAT_YN treatYn

			, A.INSERT_DT insertDt
			, A.UPDATE_DT updateDt
			, A.INSERT_USERID insertUserId
			, B2.USER_NAME insertUserName
			, A.UPDATE_USERID updateUserId
			, C2.USER_NAME updateUserName

			, A.CRUD crud
			, A.INDEX_KEY idxKey
			, A.IS_SENT

			, A.USENCHANGED_DT treatYChangedDt
			, A.USENCHANGED_USERID treatYChangedUserId
			, D2.USER_NAME treatYChangedUserName

		FROM TBL_SPC_SPECOUT_RESULT A
		INNER JOIN TBL_SPC_GOODSINSPECT GI ON  GI.ISDOOSAN_ITEM = 'Y'  
			  AND GI.USE_YN = 'Y'
			  AND A.FACT_ID = GI.FACT_ID 
			  AND A.PROC_ID = GI.PROC_ID
			   AND A.LINE_ID = GI.LINE_ID
			   AND A.GODS_ID = GI.GODS_ID
			   AND A.INSP_ID = GI.INSP_ID
	--        INNER JOIN TBL_COM_GOODS G ON A.GODS_ID = G.GODS_ID AND G.USE_YN = 'Y'
	--        LEFT JOIN TBL_COM_FACTORY F ON A.FACT_ID = F.FACT_ID AND F.USE_YN = 'Y'
	--        LEFT JOIN TBL_COM_PROCESS P ON A.PROC_ID = P.PROC_ID AND P.USE_YN = 'Y'
	--        LEFT JOIN TBL_SPC_INSPECT I ON A.INSP_ID = I.INSP_ID AND I.USE_YN = 'Y'
	--        LEFT JOIN TBL_COM_LINE L ON A.LINE_ID = L.LINE_ID AND L.USE_YN = 'Y'
			LEFT JOIN TBL_COM_CODEINFO SPT ON A.SPECOUT_TYPE = SPT.CODE AND SPT.GROUP_CODE = 'SpecOutType' AND SPT.USE_YN = 'Y'
	--        LEFT JOIN TBL_COM_CODEINFO SCP ON A.CHECK_POINT_CODE = SCP.CODE AND SCP.GROUP_CODE = 'SpecOutCheckPoint' AND SCP.USE_YN = 'Y'
			LEFT JOIN TBL_COM_MEMBERS B2 ON A.INSERT_USERID = B2.USER_ID
			LEFT JOIN TBL_COM_MEMBERS C2 ON A.UPDATE_USERID = C2.USER_ID
			LEFT JOIN TBL_COM_MEMBERS D2 ON A.USENCHANGED_USERID = D2.USER_ID
		WHERE A.ISDOOSAN_ITEM = 'Y' AND ISNULL(A.IS_SENT, 'N') = 'S'
	END
	ELSE IF (@IN_SENT = 'S')
	BEGIN
		UPDATE TBL_SPC_ABNORMAL_RESULT SET IS_SENT = 'Y'
		FROM TBL_SPC_SPECOUT_RESULT A
		INNER JOIN TBL_SPC_GOODSINSPECT GI ON  GI.ISDOOSAN_ITEM = 'Y'  
			  AND GI.USE_YN = 'Y'
			  AND A.FACT_ID = GI.FACT_ID 
			  AND A.PROC_ID = GI.PROC_ID
			   AND A.LINE_ID = GI.LINE_ID
			   AND A.GODS_ID = GI.GODS_ID
			   AND A.INSP_ID = GI.INSP_ID
		WHERE A.ISDOOSAN_ITEM = 'Y' AND A.IS_SENT = @IN_SENT
	END
END
